import React, { Component } from 'react';
import './input.css';

class Input extends Component {
    render() { 
        return (  
            <div className="container mt-5">
                <div className="row">
                    <div className="col-4"></div>
                    <div className="col-4">
                        <form>
                            <div className="form-group">
                                <label>Date</label>
                                <input type="email" className="form-control" id="exampleInputEmail1"  placeholder="Enter date" />
                                <small id="emailHelp" className="form-text text-muted">We'll never share your email with anyone else.</small>
                            </div>
                            <div className="form-group">
                                <label>Amount</label>
                                <input type="password" className="form-control" id="exampleInputPassword1" placeholder="Enter amount" />
                            </div>
                            <button type="submit" className="btn btn-primary">Append</button>
                        </form>
                    </div>
                    <div className="col-4"></div>
                </div>
            </div>
        );
    }
}

export default Input;
